DELIMITER $$
CREATE TRIGGER `delete_foods_after_username_s_delete` AFTER DELETE ON `shop_details` FOR EACH ROW BEGIN
    DELETE FROM menu
    WHERE username_s = OLD.username_s;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `update_menu_after_username_s_change` AFTER UPDATE ON `shop_details` FOR EACH ROW BEGIN
    IF NEW.username_s <> OLD.username_s THEN
        UPDATE menu
        SET username_s = NEW.username_s
        WHERE username_s = OLD.username_s;
    END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `update_order_details_after_username_s_change` AFTER UPDATE ON `shop_details` FOR EACH ROW BEGIN
    IF NEW.username_s <> OLD.username_s THEN
        UPDATE order_details
        SET username_s = NEW.username_s
        WHERE username_s = OLD.username_s;
    END IF;
END
$$
DELIMITER ;

